            <Menu />
          </Route>
          <Route path="/thumb">
            <Thumb />
          </Route>
          <Route path="/">
            {isAuthenticated ? <FeaturedMenu /> : <Login />}
          </Route>
        </Switch>
      </div>
    </Router>
  );
}
export default App;
